import React from 'react';
import '../../App.css';

export default function authors() {
  return (<><h1 className='authorsh1'>Authors:</h1>
            <h2 className='authorsh2'>Conley Deloen and Jeral Lofton</h2>
            <p1 className='authorsp1'>
                Author's Note: This is a Senior Project in 2024
                with the idea of being able to combine mutiple <br />
                different platforms achievements and trophies into
                one website. So that all the gamers would have a <br />
                place that they can get updated on there current 
                games and trophies that they are playing. 
            </p1>
        </>);
}
